    false,nt"url": null,nt"notes": "NODC Accession 0112932 includes chemical,
    meteorological, physical and underway - surface data collected from SKOGAFOSS in
    the North Atlantic Ocean, North Greenland Sea and Stellwagen Bank National Marine
    Sanctuary from 2006-03-15 to 2007-01-04 and retrieved during cruise SKO603, SKO604,
    SKO605, SKO607, SKO608, SKO609, SKO610, SKO611, SKO612 and SKO613. These data include
    ALKALINITY, BAROMETRIC PRESSURE, CARBON DIOXIDE - AIR, CARBON DIOXIDE - PARTIAL
    PRESSURE - DIFFERENCE, DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN, NITRATE, NITRITE,
    PHOSPHATE, Partial pressure (or fugacity) of carbon dioxide, SALINITY, SEA SURFACE
    TEMPERATURE, SILICATE and WATER TEMPERATURE. The instruments used to collect these
    data include Barometric pressure sensor, Carbon dioxide (CO2) gas analyzer, Shower
    head chamber equilibrator for autonomous carbon dioxide (CO2) measurement, bottle
    and thermosalinographs. These data were collected by Rik Wanninkhof, Denis Pierrot
    and Kevin Sullivan of US DOC; NOAA; OAR; Atlantic Oceanographic and Meteorological
    Laboratory as part of the VOS_Skogafoss_Lines_2006 data set.nnThe Global Volunteer
    Observing Ship (VOS) Program is coordinated by the UNESCO International Ocean Carbon
